# Define the string of bits
bits = ''

# Split the string into chunks of 17 bits, len is 4551, or just under 268 17 bit chunks
chunks = [bits[i:i+16] for i in range(0, len(bits), 17)]

# Initialize an empty list to store the transposed table
table = []

# Loop through the chunks and append them as rows to the table
for i in range(0, len(chunks), 269):
    row = chunks[i:i+269]
    table.append(row)

# Initialize an empty list to store the transposed table
transposed_table = []

# Loop through the number of columns in the original table
for j in range(len(table[0])):
    # Initialize an empty list to store the transposed row
    transposed_row = []
    
    # Loop through the number of rows in the original table
    for k in range(len(table)): 

        # Append the element at the j-th column and k-th row of the original table to the transposed row
        transposed_row.append(table[k][j])

# Append the transposed row to the transposed table
transposed_table.append(transposed_row)

# Print the transposed table
for row in transposed_table:
    print(row)
